    t[326] = "IRC networks outside I2P can also be reached if a SOCKS outproxy within I2P is known, though it depends on whether or not the outproxy has been blocked by the IRC network.";
    t[327] = "\u064a\u0645\u0643\u0646 \u0623\u064a\u0636\u064b\u0627 \u0627\u0644\u0648\u0635\u0648\u0644 \u0625\u0644\u0649 \u0634\u0628\u0643\u0627\u062a IRC \u062e\u0627\u0631\u062c I2P \u0625\u0630\u0627 \u0643\u0627\u0646 \u0648\u0643\u064a\u0644 SOCKS \u0627\u0644\u062e\u0627\u0631\u062c\u064a \u062f\u0627\u062e\u0644 I2P \u0645\u0639\u0631\u0648\u0641\u064b\u0627\u060c \u0639\u0644\u0649 \u0627\u0644\u0631\u063a\u0645 \u0645\u0646 \u0623\u0646 \u0630\u0644\u0643 \u064a\u0639\u062a\u0645\u062f \u0639\u0644\u0649 \u0645\u0627 \u0625\u0630\u0627 \u0643\u0627\u0646 \u0627\u0644\u0648\u0643\u064a\u0644 \u0627\u0644\u062e\u0627\u0631\u062c\u064a \u0642\u062f \u062a\u0645 \u062d\u0638\u0631\u0647 \u0628\u0648\u0627\u0633\u0637\u0629 \u0634\u0628\u0643\u0629 IRC \u0623\u0645 \u0644\u0627.";
