    t[349] = "\u0623\u0648\u0644 \u0634\u064a\u0621 \u0639\u0644\u064a\u0643 \u0623\u0646 \u062a\u0642\u0631\u0631\u0647 \u0647\u0648 \u0645\u0627 \u0625\u0630\u0627 \u0643\u0646\u062a \u062a\u0631\u064a\u062f \u0625\u0646\u0634\u0627\u0621 \u062e\u0627\u062f\u0645 \u0623\u0648 \u0646\u0641\u0642 \u0639\u0645\u064a\u0644.";
